import { Component, OnInit, ViewChild } from '@angular/core';
import { MatSort } from '@angular/material/sort';
import { PacienteService } from '../../services/paciente.service';
import { MatTableDataSource } from '@angular/material/table';
import { MatPaginator } from '@angular/material/paginator';
import Chart, { ChartType } from 'chart.js/auto'; 


// import pdfmake
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-calendario',
  templateUrl: './calendario.component.html',
  styleUrls: ['./calendario.component.css']
})
export class CalendarioComponent implements OnInit {

  displayedColumns: string[] = ['tipoId', 'id', 'primerNombre', 'primerApellido', 'genero', 'eliminar'];
  isFormVisible = false;

  data = new MatTableDataSource<any>([]);

  @ViewChild(MatSort) sort: MatSort;
  @ViewChild(MatPaginator) paginator: MatPaginator;

  toggleForm() {
    this.isFormVisible = !this.isFormVisible;
    
  }

  constructor(private pacienteService: PacienteService) { }

  ngOnInit(): void {
    this.llenarDato();
    this.inicializarGrafico(); // se llama el método que crea el gráfico
  }

  ngAfterViewInit() {
    this.data.sort = this.sort; // Asignar MatSort
    this.data.paginator = this.paginator;
  }

  // crear pfd
  crearPdf() {
    // poner la imagen en un Base64
  const icono = 'data:image/png;base64,';
    const pdf: any = {
      
      content: [
        {
          columns: [
            { 
              text: 'Tabla pacientes', 
              style: 'header',
              alignment: 'left',
              color: '#008b8b' // Color para el título
            },
            {
              image: icono,
              width: 80,
              alignment: 'right'
            }
          ]
        },
        {
          table: {
            widths: ['*', '*', '*', '*', '*'], // Ancho adaptable
            body: [
              [{ text: 'Tipo de identificación', style: 'tableHeader', fillColor: '#008b8b', color: 'white' },
                { text: 'Documento', style: 'tableHeader', fillColor: '#008b8b', color: 'white' },
                { text: 'Primer Nombre', style: 'tableHeader', fillColor: '#008b8b', color: 'white' },
                { text: 'Primer Apellido', style: 'tableHeader', fillColor: '#008b8b', color: 'white' },
                { text: 'Género', style: 'tableHeader', fillColor: '#008b8b', color: 'white' }],
                // Mapeo de los datos de la tabla usando this.data.data
              ...this.data.data.map(item => [
                item.tipoId,
                item.id,
                item.primerNombre,
                item.primerApellido,
                item.genero
              ])
            ]
          },
          layout: {
            fillColor: (rowIndex: number) => {
              return rowIndex % 2 === 0 ? '#ebf5f5' : null; // Color de fondo alternante en las filas (cian claro)
            }
          }
        }
      ],
      styles: {
        header: {
          fontSize: 22,
          bold: true,
          margin: [0, 0, 0, 10]
        },
      }
    };
  
    // Crear y abrir el PDF
    pdfMake.createPdf(pdf).open();
  }
  

  llenarDato(){
    this.pacienteService.getAll().subscribe(data =>{
      // Asignar los datos obtenidos al MatTableDataSource
      this.data.data = data;
      this.data.sort = this.sort;
      this.data.paginator = this.paginator;
      console.log(this.data.data);
    })
  }

  eliminarPaciente(id: string) {
    if (confirm('¿Estás seguro de que deseas eliminar este paciente?')) {
      this.pacienteService.eliminarPaciente(id).subscribe(() => {
        this.data.data = this.data.data.filter(paciente => paciente.id !== id);
        console.log(`Paciente con ID ${id} eliminado`);
      });
    }
  }

  public chart: Chart;

  inicializarGrafico(): void {
    const totalPacientes = this.data.data.length;
    const totalMasculino = this.data.data.filter(paciente => paciente.genero === 'M').length;
    const totalFemenino = this.data.data.filter(paciente => paciente.genero === 'F').length;
  
    // Datos de porcentaje para masculino y femenino (mantener los valores como números, no strings)
    const data = {
      labels: ['M', 'F'],
      datasets: [{
        label: 'porcentaje genero',
        data: [
          (totalMasculino / totalPacientes) * 100,  // Mantener como número
          (totalFemenino / totalPacientes) * 100    // Mantener como número
        ],
        backgroundColor: [
          'rgb(54, 162, 235)',  // Azul para masculino
          'rgb(255, 99, 132)'   // Rojo para femenino
        ],
        hoverOffset: 4
      }]
    };
  
    // Inicialización del gráfico de torta
    this.chart = new Chart("chart", {
      type: 'pie' as ChartType,
      data
    });
  }
  
  }

